      "summary": {
        "text": {
          "value": "<p>Tin is a chemical element with the symbol Sn (from Latin: stannum) and atomic number 50. Tin is a silvery metal that characteristically has a faint yellow hue.</p><p>Tin is soft enough to be cut with little force. When a bar of tin is bent, the so-called &quot;tin cry&quot; can be heard as a result of twinning in tin crystals; this trait is shared by indium, cadmium, zinc, and frozen mercury.</p><p>Pure tin after solidifying presents a mirror-like appearance similar to most metals. In most tin alloys (such as pewter) the metal solidifies with a dull gray color.</p><p>Tin is a post-transition metal in group 14 of the periodic table of elements. It is obtained chiefly from the mineral cassiterite, which contains stannic oxide, SnO2. Tin shows a chemical similarity to both of its neighbors in group 14, germanium and lead, and has two main oxidation states, +2 and the slightly more stable +4. Tin is the 49th most abundant element on Earth and has, with 10 stable isotopes, the largest number of stable isotopes in the periodic table, thanks to its magic number of protons.</p><p>It has two main allotropes: at room temperature, the stable allotrope is &beta;-tin, a silvery-white, malleable metal; at low temperatures it is less dense grey &alpha;-tin, which has the diamond cubic structure. Metallic tin does not easily oxidize in air.</p><p>The first tin alloy used on a large scale was bronze, made of 1&#8260;8 tin and 7&#8260;8 copper, from as early as 3000 BC. After 600 BC, pure metallic tin was produced. Pewter, which is an alloy of 85-90% tin with the remainder commonly consisting of copper, antimony, and lead, was used for flatware from the Bronze Age until the 20th century. In modern times, tin is used in many alloys, most notably tin / lead soft solders, which are typically 60% or more tin, and in the manufacture of transparent, electrically conducting films of indium tin oxide in optoelectronic applications. Another large application is corrosion-resistant tin plating of steel. Because of the low toxicity of inorganic tin, tin-plated steel is widely used for food packaging as tin cans. Some organotin compounds can be extremely toxic.</p>",
          "tags": {}
        },
        "source": {
          "value": "https://en.wikipedia.org/wiki/Tin",
          "tags": {}
        }
      },
