      "summary": {
        "text": {
          "value": "<p>Bismuth is a chemical element with the symbol Bi and atomic number 83. It is a pentavalent post-transition metal and one of the pnictogens with chemical properties resembling its lighter group 15 siblings arsenic and antimony. Elemental bismuth may occur naturally, although its sulfide and oxide form important commercial ores. The free element is 86% as dense as lead. It is a brittle metal with a silvery-white color when freshly produced, but surface oxidation can give it an iridescent tinge in numerous colours. Bismuth is the most naturally diamagnetic element and has one of the lowest values of thermal conductivity among metals.</p><p>Bismuth was long considered the element with the highest atomic mass that is stable, but in 2003 it was discovered to be extremely weakly radioactive: its only primordial isotope, bismuth-209, decays via alpha decay with a half life more than a billion times the estimated age of the universe. Because of its tremendously long half life, bismuth may still be considered stable for almost all purposes.</p><p>Bismuth metal has been known since ancient times, although it was often confused with lead and tin, which share some physical properties. The etymology is uncertain, but the word may come from the German words wei&szlig;e Masse or Wismuth (\"white mass\"), translated in the mid-sixteenth century to New Latin bisemutum or bisemutium.</p>",
          "tags": {}
        },
        "source": {
          "value": "https://en.wikipedia.org/wiki/Bismuth",
          "tags": {}
        }
      },
